import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';

import {BrowserRouter} from 'react-router-dom';
import { Provider } from "react-redux";
import { createStore, applyMiddleware, compose } from "redux";
import promise from "redux-promise";
import rootReducer from "./reducers/root";
import SignUp from './components/SignUp/SignUp';
import VideocamIcon from '@material-ui/icons/Videocam';
import { icon } from "../src/styles/icon";
import { iconContainer } from "../src/styles/icon";
import { Card } from '@material-ui/core';

const composePlugin = window.__REDUX_DEVTOOLS_EXTENSION_COMPOSE__ || compose;
const store = createStore(rootReducer, composePlugin(applyMiddleware(promise)));

class App extends Component {
 render() {
   return(
      <Provider store = {store}>
       <BrowserRouter> 
        <div>
          <div>
          <div style = {iconContainer}>
            <center><VideocamIcon style={icon} >Logo</VideocamIcon></center>
            <center>Real-Time Video Analytics  <br></br> for Threat Detection</center>
          </div>

          </div>
          <SignUp/>
        </div>
       </BrowserRouter>
     </Provider> 
   )
 }
}

export default App;
